import React, { useState } from 'react';
import MuiThemeProvider from 'material-ui/styles/MuiThemeProvider';
import AppBar from 'material-ui/AppBar';
import RaisedButton from 'material-ui/RaisedButton';
import TextField from 'material-ui/TextField';
import axios from 'axios';
import './App.css'
const Login= () =>{

  const [username, setusername] = useState(0);
  const [pass, setpass] = useState(0);
  valid-=()=>{
return username.lenght>0 &&pass.lenght>0
  }
    return (
     
        
        <MuiThemeProvider >
           <div className="container">
       <div className="child"><br/>
       <label className="loginString" >Login Page</label>
           <TextField 
             hintText="Enter your Username"
             style={styleText}
             onChange = {(event,newValue) => setusername(newValue)}
             />
           <br/> <br/>
             <TextField
               type="password"
               hintText="Enter your Password"
              style={styleText}
              onChange = {(event,newValue) => setpass(newValue)}
               />
             <br/>
             <RaisedButton label="login"  style={loginString} onClick={(event) => this.handleClick(event)}
             display ={this.valid} />
         
              
               </div>
               </div>
         </MuiThemeProvider>
     
    );
  }

const styleText={
  outlineStyle: 'solid',
  marginLeft:'15%',
  marginTop:'8%',
  width:'80%',
  fontSize:'3vh'
}

const loginString={
  outlineStyle: 'solid',
  marginLeft:'15%',
  marginTop:'50%',
  width:'80%',
  fontSize:'3vh'
}

export default Login;
